CREATE PROCEDURE InsertUser
    @id UNIQUEIDENTIFIER,
    @name NVARCHAR(255),
    @age INT,
    @city NVARCHAR(255),
    @state NVARCHAR(255),
    @country NVARCHAR(255),
    @address NVARCHAR(255),
    @picture NVARCHAR(255)
AS
BEGIN
    SET NOCOUNT ON;

    BEGIN TRY
        -- Insert statement
        INSERT INTO users (id, name, age, city, state, country, address, picture)
        VALUES (@id, @name, @age, @city, @state, @country, @address, @picture);

        -- Return success message
        SELECT 'User inserted successfully' AS Message;
    END TRY
    BEGIN CATCH
        -- Error handling
        DECLARE @ErrorMessage NVARCHAR(4000);
        DECLARE @ErrorSeverity INT;
        DECLARE @ErrorState INT;

        SELECT 
            @ErrorMessage = ERROR_MESSAGE(),
            @ErrorSeverity = ERROR_SEVERITY(),
            @ErrorState = ERROR_STATE();

        -- Return error message
        RAISERROR (@ErrorMessage, @ErrorSeverity, @ErrorState);
    END CATCH
END;
GO

CREATE PROCEDURE GetUserById
    @id UNIQUEIDENTIFIER
AS
BEGIN
    SET NOCOUNT ON;

    BEGIN TRY
        -- Select statement
        SELECT id, name, age, city, state, country, address, picture
        FROM users
        WHERE id = @id;
    END TRY
    BEGIN CATCH
        -- Error handling
        DECLARE @ErrorMessage NVARCHAR(4000);
        DECLARE @ErrorSeverity INT;
        DECLARE @ErrorState INT;

        SELECT 
            @ErrorMessage = ERROR_MESSAGE(),
            @ErrorSeverity = ERROR_SEVERITY(),
            @ErrorState = ERROR_STATE();

        -- Return error message
        RAISERROR (@ErrorMessage, @ErrorSeverity, @ErrorState);
    END CATCH
END;
GO

CREATE PROCEDURE UpdateUser
    @id UNIQUEIDENTIFIER,
    @name NVARCHAR(255),
    @age INT,
    @city NVARCHAR(255),
    @state NVARCHAR(255),
    @country NVARCHAR(255),
    @address NVARCHAR(255),
    @picture NVARCHAR(255)
AS
BEGIN
    SET NOCOUNT ON;

    BEGIN TRY
        -- Update statement
        UPDATE users
        SET name = @name,
            age = @age,
            city = @city,
            state = @state,
            country = @country,
            address = @address,
            picture = @picture
        WHERE id = @id;

        -- Return success message
        SELECT 'User updated successfully' AS Message;
    END TRY
    BEGIN CATCH
        -- Error handling
        DECLARE @ErrorMessage NVARCHAR(4000);
        DECLARE @ErrorSeverity INT;
        DECLARE @ErrorState INT;

        SELECT 
            @ErrorMessage = ERROR_MESSAGE(),
            @ErrorSeverity = ERROR_SEVERITY(),
            @ErrorState = ERROR_STATE();

        -- Return error message
        RAISERROR (@ErrorMessage, @ErrorSeverity, @ErrorState);
    END CATCH
END;
GO

CREATE PROCEDURE DeleteUser
    @id UNIQUEIDENTIFIER
AS
BEGIN
    SET NOCOUNT ON;

    BEGIN TRY
        -- Delete statement
        DELETE FROM users
        WHERE id = @id;

        -- Return success message
        SELECT 'User deleted successfully' AS Message;
    END TRY
    BEGIN CATCH
        -- Error handling
        DECLARE @ErrorMessage NVARCHAR(4000);
        DECLARE @ErrorSeverity INT;
        DECLARE @ErrorState INT;

        SELECT 
            @ErrorMessage = ERROR_MESSAGE(),
            @ErrorSeverity = ERROR_SEVERITY(),
            @ErrorState = ERROR_STATE();

        -- Return error message
        RAISERROR (@ErrorMessage, @ErrorSeverity, @ErrorState);
    END CATCH
END;
GO

